<p style="text-align: justify;"><strong>Career</strong></p>
<p style="text-align: justify;">The first role of Boseman was in an episode of <strong>Third watch</strong> in 2003 which was followed by his work on some of the renowned series like <strong>Law and Order, CSI: NY,</strong> <strong>ER</strong> and <strong>Persons Unknown</strong>.Â  While working on series he also continued his work as a play writer subsequently his script for <em>Deep Azure</em> was performed at the Congo Square Theatre Company, Chicago which got nominated in<strong> 2006 Joseph Jefferson</strong> Award for New York.</p>
<img class="aligncenter wp-image-1489" src="http://wikiceleb.com/wp-content/uploads/2018/01/Chadwick-Boseman-in-The-Kill-Hole-300x181.jpg" alt="" width="537" height="324" />
<p style="text-align: justify;">Though his first feature film was <strong>The Express </strong>(2008), he got recognition only in 2013 with his role as Jackie Robinson in the movie <strong>42</strong>. In the following year, he acted on <strong>Draft Day</strong> and <strong>Get on Up</strong>. His performance and acting skills were critically praised for his role as James Brown in <strong>Get on Up</strong>.</p>
<p style="text-align: justify;">Recently in 2016 he finally got the boost in his acting career that he had been waiting for by bagging the role of Tâ€™Challa/ Black Panther in the movie <strong>Captain America: Civil war</strong>, the first in a five picture deal with one of the biggest franchises <strong>Marvel</strong> for which he was widely admired worldwide. Moreover, he is set to reprise the role in the much awaited and talked about movie <strong>Black Panther</strong>Â which became one of the highest movies inÂ  2018. Additionally, he will be seen inÂ  <strong>Avengers: Infinity WarÂ </strong>reprising the same role.</p>
<img class="aligncenter wp-image-1490" src="http://wikiceleb.com/wp-content/uploads/2018/01/panther_shield-300x163.jpg" alt="" width="539" height="293" />
<p style="text-align: justify;"><strong>Personal Life</strong></p>
<p style="text-align: justify;">After his popularity as Black Panther people all around the globe are interested to know about his love life. The actor is unmarried and doesnâ€™t have any kids as of yet. Like most of the celebrities he also chooses to keep his personal relationships a secret. Lately, in 2017 reporters have caught Boseman with a mysterious girl in many occasions like in airport and also in L.A. where he stopped by to shoot for Jimmy Kimmel Live but the Marvel superhero has not clarified on the news of his relationship with the girl.</p>
<img class="wp-image-941 aligncenter" src="http://wikiceleb.com/wp-content/uploads/2018/01/boseman-marshall-22jun17-03-246x300.jpg" alt="" width="349" height="426" />
<p style="text-align: justify;"><strong>Net worth</strong></p>
<p style="text-align: justify;">Chadwick has acted in mainstream series and movies since 2003. His association with the Marvels has naturally uplifted his net worth.Â  Currently, the actor is entitled to a net worth of $5 million.</p>
<p style="text-align: justify;">Chadwick is an extremely talented, diligent and driven actor, although it took him some time to reach his well-deserved position in the industry, his upcoming projects are extremely promising and we sincerely hope that his future projects entitle him to be one of the leading actors in Hollywood.</p>
