<img class="aligncenter wp-image-949" src="http://wikiceleb.com/wp-content/uploads/2018/01/Sweden-national-team-300x197.jpg" alt="" width="537" height="352" />

<strong><u>World Cup Qualifier Europe</u></strong>
<p style="text-align: justify;">The World Cup qualifier in Europe selects 14 countries for the FIFA World Cup and for 2018 FIFA World Cup; Russia qualifies for being a host country. 52 countries who are the members of FIFA from Europe go for the preliminary competition where those 5 countries were divided into 9 groups in which 7 groups contain 6 teams and rest of the two groups contain only 5 teams. <a href="http://wikiceleb.com/england-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">England</a>,Â <a style="font-style: inherit; font-weight: inherit;" href="http://wikiceleb.com/france-road-russia-fifa-world-cup-2018/">France</a>, Germany, Italy, Netherlands, andÂ <a style="font-style: inherit; font-weight: inherit;" href="http://wikiceleb.com/spain-road-russia-fifa-world-cup-2018/">Spain</a>Â are placed in a group containing 6 teams. Winners from each group qualify automatically and the eight best runners-up go for the playoffs from which 4 teams are selected. Thus, in this way, the Europe qualifier selects 14 nations for the FIFA World Cup.</p>
<p style="text-align: justify;">Sweden managed to stay at second Place of the group A with France as the group leader. Sweden managed to win a total of seven games with ten games played along with one draw and 3 losses. Sweden managed to qualify for FIFA World Cup 2018 through the play-offs rounds.</p>
<img class="aligncenter wp-image-950" src="http://wikiceleb.com/wp-content/uploads/2018/01/2018-world-cup-qualifications-europe-sweden-italy_8251b846-c68c-11e7-94e0-d13ec9d58666-300x191.jpg" alt="" width="545" height="347" />

<strong><u>FIFA World Cup 2018 Group F</u></strong>

