www.wikiceleb.com";s:10:"post_title";s:41:"Sweden Road To Russia FIFA World Cup 2018";s:12:"post_excerpt";s:0:"";s:11:"post_status";s:7:"publish";s:14:"comment_status";s:4:"open";s:11:"ping_status";s:4:"open";s:13:"post_password";s:0:"";s:9:"post_name";s:38:"sweden-road-russia-fifa-world-cup-2018";s:7:"to_ping";s:0:"";s:6:"pinged";s:0:"";s:13:"post_modified";s:19:"2018-01-23 23:29:16";s:17:"post_modified_gmt";s:19:"2018-01-23 17:44:16";s:21:"post_content_filtered";s:0:"";s:11:"post_parent";s:1:"0";s:4:"guid";s:27:"http://wikiceleb.com/?p=947";s:10:"menu_order";s:1:"0";s:9:"post_type";s:4:"post";s:14:"post_mime_type";s:0:"";s:13:"comment_count";s:1:"0";}i:2;O:8:"stdClass":23:{s:2:"ID";s:3:"959";s:11:"post_author";s:1:"1";s:9:"post_date";s:19:"2018-01-14 23:01:59";s:13:"post_date_gmt";s:19:"2018-01-14 17:16:59";s:12:"post_content";s:5415:"<p style="text-align: justify;">One of the rising performers and beautiful actresses of Hollywood Daisy Jazz Isobel Ridley was born and bought up in the United Kingdom.Â  She was born as a daughter to Louis Fawkner Corbett and Chris Ridley on 10 April 1992 in London. Her great-uncle Arnold Ridley was a famous English actor and play writer. Ridley graduated from Tring Park School for the Performing Arts on scholarship. Moreover, she began studying for Bachelor of Arts in social science through online courses affiliated to Open University.</p>
<p style="text-align: justify;"><strong>Career </strong></p>
<p style="text-align: justify;">After graduating in 2010 Daisy was part of many British television programs such as <strong><em>Youngers</em></strong>, <strong><em>Toast of London</em></strong>, <strong><em>Silent Witness</em></strong>, <strong><em>Mr. Selfridge</em></strong> and <strong><em>Casualty</em></strong> also, few short and interactive films like <strong><em>Blue Season</em></strong> and <strong><em>LifeSaver</em></strong>. She even appeared on a music video for <strong><em>Wiley</em></strong>â€™s song <strong><em>Lights on</em></strong>.Â  She made her film debut with Scrawl, a British independent horror movie in 2015.</p>
<p style="text-align: justify;">Ridley got her breakthrough role when she was casted as Rey, main protagonist in <strong><em>Star Wars: The Force Awakens</em></strong>, the first film in the new reboot of Star Wars trilogy. Prior to Star Wars Daisy was relatively unknown to the industry but she has been the talk of the town ever since the movie released and became one of the highest grossing movie of 2015. Many reviewers termed her as â€œreal star of the movieâ€ all thanks to her commendable performance in the movie.</p>
<p style="text-align: justify;">In January 2016, Ridley became an executive producer for the documentary <strong><em>The Eagle Huntress</em></strong>. Likewise, she was featured on <strong>Barbara Streisand</strong>â€™s 2016 album <strong><em>Encore: Movie Partners Sing Broadway. </em></strong></p>
<p style="text-align: justify;">Furthermore, Ridley starred in <strong><em>Murder on the Orient Express</em></strong> and <strong><em>Star Wars: The Last Jedi</em></strong> in 2017 which was also a huge success and uplifted her career even more.</p>
<img class="aligncenter wp-image-963" src="http://wikiceleb.com/wp-content/uploads/2018/01/The-Last-Jedi-Changes-300x129.jpeg" alt="" width="551" height="237" />
<p style="text-align: justify;"><strong>Future projects</strong></p>
<p style="text-align: justify;">Daisy is set to star in <strong><em>Ophelia</em></strong> in January 2018. More than that, she will be featured on <strong><em>Chaos Walking</em></strong>, an adaptation of adult novel by Patrick Ness.Â  Additionally, Ridley is signed by J.J Abrams for <strong><em>Star Wars: Episode IX</em></strong>, <strong><em>Kolma</em></strong> and <strong><em>A Woman of No Importance</em></strong>. She will also reteam with Josh Gad in a superhero comedy <strong><em>Super- Normal</em></strong> which is to be released by Netflix.</p>
<p style="text-align: justify;"><strong>Personal Life</strong></p>
<p style="text-align: justify;">Ridley is a big fan of football club Arsenal F.C. Not much is known about the love life of this beautiful actress but she has been rumored to be dating actor <strong><em>Tom Bateman</em></strong> whom she met while filming Sir Kenneth Branaghâ€™s <strong><em>Murder on the Orient Express</em></strong>.</p>
<img class=" wp-image-962 aligncenter" src="http://wikiceleb.com/wp-content/uploads/2018/01/dating-300x247.jpg" alt="" width="468" height="385" />
<p style="text-align: justify;"><strong>Achievements</strong></p>
<p style="text-align: justify;"><strong>Â </strong>Daisy has been listed in Peopleâ€™s magazine Worldâ€™s Most Beautiful 2016 and also on Debrettâ€™s 2016 most influential people in the UK. On top of that, the actress has won <strong><em>Outstanding Acting Performance </em></strong>in 2015 for her movie Scrawl at <strong><em>Zest Fest Film Festival.</em></strong></p>
<img class="aligncenter wp-image-964" src="http://wikiceleb.com/wp-content/uploads/2018/01/2f29faf3f8cb0b55ab1806d1a3251c82-282x300.jpg" alt="" width="488" height="519" />
<p style="text-align: justify;">To add to her list of accomplishments, Ridley achieved <strong><em>Best Female Newcomer</em></strong>, <strong><em>Best Breakthrough Performance </em></strong>along with <strong><em>Choice Movie: Breakout Star</em></strong> at 2016 <strong><em>Empire Awards</em></strong>, <strong><em>MTV Movie Awards</em></strong> and <strong><em>Teen Choice Awards</em></strong> respectively for her role in Star Wars: The Force Awakens.</p>
<p style="text-align: justify;"><strong>Net Worth</strong></p>
<p style="text-align: justify;">The British actress was relatively anonymous before her association with The Star Wars. The net worth of Ridley as of 2018 is estimated to be $ 2 million.</p>
<p style="text-align: justify;">The achievements and proficient acting skills of Ridley prove that she is much more than just a pretty face and we are extremely confident that her forthcoming projects will further enable her to triumph hearts of people all over the globe.</p>
